import React from 'react';
import styled from 'styled-components';
import HomeIcon from '@material-ui/icons/Home';

const Nav = styled.div`
    width: 100vw;
    height: 30px;
    background: white;
    border-bottom: 2px solid #707070;
`;

const Navbar = () => {
    return (
        <div>
            <HomeIcon color="secondary" />
            <HomeIcon color="secondary" />
            <Nav>
                <HomeIcon color="secondary" />
                <HomeIcon color="secondary" />
            </Nav>
        </div>
    );
};

export default Navbar;
